import React from 'react';
import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import TargetList from './TargetList';
import SuppresionList from './SuppresionList';


function Navbar() {
    return (
        <div>
        
        <Router>
             <Route path = "/" component = {TargetList} exact>Target</Route>
             <Link to="/">Target List </Link>
             <Route path = "SuppresionList" component = {SuppresionList}>Suppression</Route>
             <Link to="/SuppresionList">SuppressionList </Link>
       </Router>
       
        </div>
   
    )
}

export default Navbar
